import React from "react";
import { Link } from "react-router-dom";

function SiteHeader({ actionLabel = "Добавить материал", actionTo = "/posts/new" }) {
  return (
    <header className="main-header">
      <div className="container narrow header-simple">
        <div className="brand-block">
          <Link to="/" className="logo">ДомРынок</Link>
          <p className="logo-subtitle">Спокойная лента событий о недвижимости</p>
        </div>
        <nav className="main-nav">
          <Link to="/" className="nav-link">Лента</Link>
          {actionLabel && actionTo && (
            <Link to={actionTo} className="btn btn-primary">
              {actionLabel}
            </Link>
          )}
        </nav>
      </div>
    </header>
  );
}

export default SiteHeader;
